import type Shape from './Shape';
import Rectangle from './Rectangle';
import Polygon from './Polygon';
import Ellipse from './Ellipse';
import Circle from './Circle';
import Cuboid from './Cuboid';
import LShape from './LShape';
import Line from './Line';
import Dot from './Dot';
import Grid from './Grid';
import Arrow from './Arrow';
import TrapezoidalPrism from './TwoSidesCuboid';
import { ShapeType, ShapeData, ShapeOptions } from './types';

export default class ShapeFactory {
  static getShape(shapeType: ShapeType, options: ShapeOptions): Shape<ShapeData> | null {
    switch (shapeType) {
      case ShapeType.RECTANGLE:
        return new Rectangle(options);
      case ShapeType.POLYGON:
        return new Polygon(options);
      case ShapeType.ELLIPSE:
        return new Ellipse(options);
      case ShapeType.CIRCLE:
        return new Circle(options);
      case ShapeType.CUBOID:
        return new Cuboid(options);
      case ShapeType.LSHAPE:
        return new LShape(options);
      case ShapeType.LINE:
        return new Line(options);
      case ShapeType.DOT:
        return new Dot(options);
      case ShapeType.GRID:
        return new Grid(options);
      case ShapeType.ARROW:
        return new Arrow(options);
      case ShapeType.TWO_SIDES_CUBOID:
        return new TrapezoidalPrism(options);
      default:
    }
    return null;
  }
}
